export default function App() {
  return (
    <View style={styles.container}>
      <DrawStaff></DrawStaff>
      <Playground />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "lightblue",
    alignSelf: "stretch"

    // flexDirection: "column"
  },
  staves: {
    flex: 1,
    flexDirection: "row"
  },
  drawstaff: {
    flex: 1
  }
});
